import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useNavigate} from 'react-router-dom';
import '../styles/FacultyDashboard.css'; // Styles for full-page layout

const FacultyDashboard = () => {
  const [selectedTab, setSelectedTab] = useState('details');
  const [facultyDetails, setFacultyDetails] = useState(null);
  const [semesters, setSemesters] = useState([]);
  const [subjects, setSubjects] = useState([]);
  const [students, setStudents] = useState([]);
  const [selectedSemester, setSelectedSemester] = useState('');
  const [selectedSubject, setSelectedSubject] = useState('');
  const navigate = useNavigate();

  useEffect(() => {
    const fetchFacultyDetails = async () => {
      try {
        const token = localStorage.getItem('facultyToken');
        const email = localStorage.getItem('facultyEmail');

        // Redirect to login if no token or email found
        if (!token || !email) {
          console.error('Authentication failed. Redirecting to login.');
          navigate('/faculty-login');
          return;
        }

        // Fetch faculty details using email
        const response = await axios.get(`http://localhost:5000/api/faculty/details?email=${email}`, {
          headers: { Authorization: `Bearer ${token}` },
        });
        setFacultyDetails(response.data);

        // Fetch semesters handled by the faculty
        const responseSemesters = await axios.get('http://localhost:5000/api/faculty/handlingSemesters', {
          headers: { Authorization: `Bearer ${token}` },
        });
        setSemesters(responseSemesters.data);
      } catch (err) {
        console.error('Error fetching faculty details:', err);
        navigate('/faculty-login'); // Redirect to login in case of an error
      }
    };

    fetchFacultyDetails();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('facultyToken');
    localStorage.removeItem('facultyEmail');
    navigate('/faculty-login');
  };

  const handleSemesterSelect = async (semester) => {
    setSelectedSemester(semester);
    try {
      const token = localStorage.getItem('facultyToken');
      const response = await axios.get(`http://localhost:5000/api/subjects?semester=${semester}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setSubjects(response.data);
    } catch (err) {
      console.error('Error fetching subjects:', err);
    }
  };

  const handleSubjectSelect = async (subjectCode) => {
    setSelectedSubject(subjectCode);
    try {
      const token = localStorage.getItem('facultyToken');
      const response = await axios.get(`http://localhost:5000/api/students?subjectCode=${subjectCode}`, {
        headers: { Authorization: `Bearer ${token}` },
      });
      setStudents(response.data);
    } catch (err) {
      console.error('Error fetching students:', err);
    }
  };

  const renderTabContent = () => {
    switch (selectedTab) {
      case 'details':
        return (
          <div className="details-tab">
            <h2>Faculty Details</h2>
            <button onClick={handleLogout}>Logout</button>
            <p><strong>Name:</strong> {facultyDetails?.name || 'Loading...'}</p>
            <p><strong>Email:</strong> {facultyDetails?.email || 'Loading...'}</p>
            <p><strong>Branch:</strong> {facultyDetails?.branch || 'Not Assigned'}</p>
            <div>
              <h3>Handling Semesters:</h3>
              <ul>
                {facultyDetails?.handlingSemesters?.map((semester, index) => (
                  <li key={index}>{semester}</li>
                )) || <p>No semesters available</p>}
              </ul>
            </div>
            <div>
              <h3>Subjects:</h3>
              <ul>
                {facultyDetails?.subjectNames?.map((subject, index) => (
                  <li key={index}>
                    <strong>{subject.name}</strong> ({subject.code})
                  </li>
                )) || <p>No subjects available</p>}
              </ul>
            </div>
          </div>
        );

      case 'assessment':
        return (
          <div className="assessment-tab">
            <h2>Assessment</h2>
            <div>
              <label>Select Semester:</label>
              <select onChange={(e) => handleSemesterSelect(e.target.value)} value={selectedSemester}>
                <option value="">-- Select Semester --</option>
                {semesters.map((semester) => (
                  <option key={semester} value={semester}>
                    {semester}
                  </option>
                ))}
              </select>
            </div>
            {selectedSemester && (
              <div>
                <label>Select Subject:</label>
                <select onChange={(e) => handleSubjectSelect(e.target.value)} value={selectedSubject}>
                  <option value="">-- Select Subject --</option>
                  {subjects.map((subject) => (
                    <option key={subject.code} value={subject.code}>
                      {subject.name}
                    </option>
                  ))}
                </select>
              </div>
            )}
            {selectedSubject && (
              <div>
                <h3>Students List:</h3>
                <table>
                  <thead>
                    <tr>
                      <th>First Name</th>
                      <th>CAT 1</th>
                      <th>CAT 2</th>
                      <th>Model</th>
                      <th>Sem Grade</th>
                    </tr>
                  </thead>
                  <tbody>
                    {students.map((student) => (
                      <tr key={student._id}>
                        <td>{student.firstName}</td>
                        <td>{student.cat1 || '-'}</td>
                        <td>{student.cat2 || '-'}</td>
                        <td>{student.model || '-'}</td>
                        <td>{student.semGrade || '-'}</td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            )}
          </div>
        );

      case 'change-course':
        return <p>Change Course functionality coming soon!</p>;

      default:
        return <p>Select a tab to view content</p>;
    }
  };

  return (
    <div className="faculty-dashboard">
      <div className="sidebar">
        <button onClick={() => setSelectedTab('details')}>Details</button>
        <button onClick={() => setSelectedTab('assessment')}>Assessment</button>
        <button onClick={() => setSelectedTab('change-course')}>Change Course</button>
      </div>
      <div className="main-content">{renderTabContent()}</div>
    </div>
  );
};

export default FacultyDashboard;
